    return (
        <div className="rowHeader">

        <label className="toggleSwitch" onclick="">
			<input type="checkbox" checked />
				<span>
				    <span className="left-span">Today</span>
					<span className="right-span">This Week</span>
				</span>											
		</label>

        </div>
    )
}
